import React from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

const Cost = (props) => {
  // console.log(this.props);
  return (
    <div>
      <Container
        style={{
          alignitems: "center",
          textAlign: "left",
          fontWeight: "bold",
          color: "blue",
        }}
      >
        <Card>
          <Card.Body>
            {props.budget((total) => total.budget)}

            {/* {props.items.map((item, index) => (
              <h1>{item.items}</h1>
            ))} */}
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};
// }

export default Cost;
